import React from 'react';
import { Link as RouterLink } from 'react-router-dom';
import { ChakraProvider, Button, Link, Center } from "@chakra-ui/react";


function Home() {
    return (
        <ChakraProvider>
            <Center>
                This is the homepage. <br />
            </Center>
            <Center h='40em'>

                <Link as={RouterLink} to='/Game'>Start Game</Link>
                <Link as={RouterLink} to='/About'>Learn More</Link>
            </Center>
        </ChakraProvider>
    );
}

export default Home;
